function fetchSkins($dir, $arr, $prefix = []) {
    foreach ($arr as $enumName => $skinBlob) {
        if (is_array($skinBlob)) {
            $newArr = $prefix;
            array_push($newArr, $enumName);
            fetchSkins($dir, $skinBlob, $newArr);
            continue;
        }
        $obj = base64_decode($skinBlob);
        $obj = json_decode($obj, true);
        $curlOut = fetchSkin($obj['textures']['SKIN']['url']);
        $fileName = $dir;
        if (sizeof($prefix) > 0) {
            $fileName .= '/' . implode('/', $prefix);
        }
        $fileName .= '/' . $enumName . '.png';
        @mkdir(dirname($fileName), 0777, true);
        echo $fileName;
        echo '<br>';
        file_put_contents($fileName, $curlOut);
    }
}
function fetchSkin($url) {
    $ch = curl_init();
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
    curl_setopt($ch, CURLOPT_TIMEOUT_MS, 2500);
    curl_setopt($ch, CURLOPT_CONNECTTIMEOUT_MS, 2500);
    curl_setopt($ch, CURLOPT_USERAGENT, 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.85 Safari/537.36');
    curl_setopt($ch, CURLOPT_FRESH_CONNECT, TRUE);
    curl_setopt($ch, CURLOPT_IPRESOLVE, CURL_IPRESOLVE_V4);
    return curl_exec($ch);
}